            color: #414141;
            font-size: 24px;
            font-weight: bold;
            padding: 15px 0;
        }

        .error-code {
            font-family: "OpenSansRegular", Arial, sans-serif;
            color: #c137a2;
            font-size: 20px;
            margin-top: 10px;
        }

        .error-description {
            font-family: "Courier New", sans-serif;
            color: #414141;
            white-space: pre-line;
            font-size: 20px;
            max-height: 25vh;
            overflow: auto;
            background: rgba(245, 245, 245, 0.8);
            margin-top: 10px;
        }

        .error-button {
            margin-top: 30px;
            text-align: center;
        }

        .error-button a {
            line-height: 1;
            font-family: "Futura", "OpenSansRegular", Arial, sans-serif;
            font-family: Roboto, "Helvetica Neue", sans-serif;
            font-weight: 500;
            line-height: 36px;
            min-width: 64px;
            display: inline-block;
            -webkit-appearance: none;
            -moz-appearance: none;
            appearance: none;
            border: none;
            outline: 0;
            background: #694ed6;
            color: #ffffff;
            overflow: hidden;
            position: relative;
            border-radius: 40px;
            padding: 12px 19px;
            font-size: 15px;
            border-radius: 18px;
            padding: 0 16px;
            font-size: 14px;
            transition: background-color .2s ease-in-out;
            text-decoration: none;
            cursor: pointer;
        }

        .error-button a:hover {
            background-color: #4b2dc4;
        }
    </style>
</head>

<body>
    <div class="ribbon">
        <div flex class="error-box">
            <div class="error-img"></div>
            <div class="sorry-msg">
                {{title}}
            </div>
            <div class="error-code">
                <span style="font-weight: bold;">{{subtitle}}</span>
            </div>
            <div class="error-description">
                {{description}}
            </div>
            <div class="error-button">
                <a href="{{redirectLink}}" class="btn">{{redirectLabel}}</a>
            </div>
        </div>
    </div>
</body>

</html>
